FILE* file_open(char* filename) {
    FILE* fobj=fopen(filename,"r");
    if (!fobj) {
        fprintf(stderr,"Could not open file: %s\n", filename);
        exit(45);
    }
    return fobj;
}

kh_md5_t * load_master(char* filename) {
    char name[255], md5sum[33];
    int namestart=2;
    int ret=0;
 khiter_t k;
    kh_md5_t *hmap = kh_init_md5();
    FILE* fobj=file_open(filename);

    while ((fscanf(fobj, "%s %s", md5sum, name) == 2)) {
        k=kh_put_md5(hmap, strdup(name+2), &ret);

        ((hmap)->vals[k]) = strdup(md5sum);
    }
    fclose(fobj);

    return hmap;
}

void compare_md5sums(kh_md5_t* master_hash, char* filename) {
    char name[255], md5sum[33];
 khiter_t k;
    FILE* fobj=file_open(filename);

    while ((fscanf(fobj, "%s %s", md5sum, name) == 2)) {

        k=kh_get_md5(master_hash, name+27);

        if (k == ((master_hash)->n_buckets)) {
            fprintf(stderr,"%s not found in master list\n", name);
        } else {
            char* master_md5sum = ((master_hash)->vals[k]);
            if (strcmp(md5sum, master_md5sum) != 0) {
                fprintf(stderr,"%s has md5sum %s instead of %s\n",
                               name, md5sum, master_md5sum);
            }
        }
    }
}
int main(int argc, char** argv) {
    kh_md5_t *master_hash = ((void *)0);
    if (argc < 3) {
        puts("usage: checksum-compare master_list test_list\n");
        exit(45);
    }

    master_hash = load_master(argv[1]);
    compare_md5sums(master_hash, argv[2]);

    return 0;
}
